let originalData = [];
let tr_update = [];
let isUpdateNote = false;
let selectedSupplierId = 0;
let taskId = 0;
let updateTaskOriginalData = [];

let source = {
    datafields: [{
            name: 'studentId',
            type: 'int'
        },
        {
            name: 'schoolId',
            type: 'int'
        },
        {
            name: 'suppliersId',
            type: 'int'
        },
        {
            name: 'serviceId',
            type: 'int'
        },
        {	
            name: 'referenceNo',
            type: 'string'
        },
        {
            name: 'quantity',
            type: 'int'
        },
        {
            name: 'purpose',
            type: 'string'
        },
        {
            name: 'debitDate',
            type: 'date'
        },
        {
            name: 'amountDebt',
            type: 'number'
        },
        {
            name: 'sClass',
            type: 'int'
        },
        {
            name: 'grade',
            type: 'int'
        },
        {
            name: 'delYn',
            type: 'string'
        },
        {
            name: 'insertId',
            type: 'int'
        },
        {
            name: 'insertDate',
            type: 'string'
        },
        {
            name: 'updateId',
            type: 'int'
        },
        {
            name: 'updateDate',
            type: 'string'
        },
        {
            name: 'nameStudent',
            type: 'string'
        },
        {
            name: 'nameService',
            type: 'string'
        },
        {
            name: 'price',
            type: 'number'
        },
        {
            name: 'id',
            type: 'int'
        },
        {
            name: 'taskId',
            type: 'int'
        }
    ],
    datatype: "array",
    localdata: null,
    updaterow: function (rowid, rowdata, commit) {
        let beforeData = originalData[rowid];
        let selectedRowData = $('#grdStudentDebts').jqxGrid('getrowdata', rowid);
        if (Object.keys(beforeData).length > 0 && Object.keys(selectedRowData).length > 0) {
            if (beforeData.quantity === selectedRowData.quantity) {
                if (tr_update.length > 0) {
                    tr_update = tr_update.filter(item => item.referenceNo !== selectedRowData.referenceNo);
                }
                
                return;
            }
            if (tr_update.length > 0) {
                tr_update = tr_update.filter(item => {
                	if (item.referenceNo === selectedRowData.referenceNo) {                		
                		return (item.referenceNo !== selectedRowData.referenceNo);
                	} else {
                		return true;
                	}
                });
            }
            tr_update.push({
            	quantity: selectedRowData.quantity,
            	amountDebt: selectedRowData.amountDebt,
            	studentId: selectedRowData.studentId,
            	referenceNo: selectedRowData.referenceNo,
            	id: selectedRowData.id,
            	taskId: selectedRowData.taskId
            });
        }

        commit(true);
    }
};

function createGrid() {
    let dataAdapter = new $.jqx.dataAdapter(source);
    $("#grdStudentDebts").jqxGrid({
        source: dataAdapter,
        selectionmode: 'singlecell',
        editable: true,
        columns: [{
                text: 'Name student',
                datafield: 'nameStudent',
                align: 'center',
                cellsalign: 'center',
                width: '16,6667%',
                editable: false,
            },
            {
                text: 'Reference No',
                datafield: 'referenceNo',
                align: 'center',
                cellsalign: 'center',
                width: '16,6667%',
                editable: false,
            },
            {
                text: 'Service',
                datafield: 'nameService',
                align: 'center',
                cellsalign: 'center',
                width: '16,6667%',
                editable: false,
            },
            {
                text: 'Quantity',
                columntype: 'textbox',
                datafield: 'quantity',
                align: 'center',
                cellsalign: 'right',
                width: '16,6667%',
                editable: true,
                cellsformat: 'd'
            },
            {
                text: 'Price',
                datafield: 'price',
                align: 'center',
                cellsalign: 'right',
                width: '16,6667%',
                editable: false,
                cellsformat: 'd2'
            },
            {
                text: 'Amount of debit',
                datafield: 'amountDebt',
                columntype: 'textbox',
                align: 'center',
                cellsalign: 'right',
                editable: false,
                cellsformat: 'd2'
            },
        ],
        theme: 'bootstrap',
        width: '100%',
        height: SS.grid.customheight(450),
        rowsheight: 33
    });
    $("#grdStudentDebts").jqxGrid('localizestrings', SS.grid.localization);
}

function init() {
    
    $("#iptDateSrch").jqxDateTimeInput({
        height: SS.IPT_HEIGHT,
        width: '100%',
        disabled: true
    });
    $("#iptPriceSrch").jqxInput({
        height: SS.IPT_HEIGHT,
        width: '100%',
        disabled: true
    });
    $("#cmbStdGradeSrch").jqxDropDownList({
        enableBrowserBoundsDetection: true,
        source: SS.dataSource.grade('All'),
        displayMember: 'name',
        valueMember: 'id',
        selectedIndex: 0,
        height: SS.IPT_HEIGHT,
        width: '100%',
        dropDownHorizontalAlignment: 'right'
    });
    $("#cmbStdClazzSrch").jqxDropDownList({
        enableBrowserBoundsDetection: true,
        source: SS.dataSource.clazz('All'),
        displayMember: 'name',
        valueMember: 'id',
        selectedIndex: 0,
        height: SS.IPT_HEIGHT,
        width: '100%',
        dropDownHorizontalAlignment: 'right'
    });
    $("#cmbStdServiceSrch").jqxDropDownList({
        enableBrowserBoundsDetection: true,
        height: SS.IPT_HEIGHT,
        width: '100%',
        dropDownHorizontalAlignment: 'right',
        disabled: true
    });
    $("#cmbStdInstSrch").jqxDropDownList({
        enableBrowserBoundsDetection: true,
        height: SS.IPT_HEIGHT,
        width: '100%',
        dropDownHorizontalAlignment: 'right',
        disabled: true
    });

    $("#iptComment").jqxTextArea({
        width: 450,
        height: 100,
        placeHolder: 'Enter note on the purpose of the payment...'
    });
}

$(document).ready(function() {
	init();
	createGrid();
	
    $("#grdStudentDebts").on('cellvaluechanged', function (event) {
        let args = event.args;
        let datafield = args.datafield;
        let rowIndex = args.rowindex;
        let value = +args.newvalue;
        let selectedRowData = $('#grdStudentDebts').jqxGrid('getrowdata', rowIndex);
        let price = +selectedRowData.price
        if (datafield === 'quantity') {
            if (value < 0) $("#grdStudentDebts").jqxGrid('setcellvalue', rowIndex, "quantity", value * (-1));
            $("#grdStudentDebts").jqxGrid('setcellvalue', rowIndex, "amountDebt", (value < 0) ? (value * price * (-1)) : (value * price));
        }
    });
    
    $("#iptComment").on("change", function() {
        if (updateTaskOriginalData.note !== $("#iptComment").val()) {
        	isUpdateNote = true;
        } else {
        	isUpdateNote = false;
        }
    });
    

    $('#btnPrint').on('click', function() {
    	if (tr_update && tr_update.length > 0) {
    		SS.alert(SS.title.ERROR, "Please save or undo the change before printing");
    		return;
    	}
    	let studentsInfo = [];
    	SS.sendToServer(
	        'ST_R_03',
	        false,
	        {},
	        function onSuccess(data) {
	        	if (data && data.lst) {
	        		studentsInfo.push(...data.lst);
	        	}
	        }
	    );
    	let paymentPurpose = $("#iptComment").val();
    	
    	let rows = $("#grdStudentDebts").jqxGrid('getrows');
        let newWindow = window.open('', '', 'width=800, height=500'),
        document = newWindow.document.open(),
        pageContent =
            `<!DOCTYPE html>
            <html><head>
			    <link rel="stylesheet" type="text/css">
			        <style>
			            @media print {
			                * {-webkit-print-color-adjust:exact;}
			                body, .invoice {
			                    margin: 0;
			                }
			            }
			            body {
			                font-family: Arial,Verdana,Helvetica,Clean,Sans-serif;
			                font-size: 13px;
			                background: #fff;
			                margin: 0;
			            }
			            .invoice{
			                display:block;position:relative;left:0;height: 380px;
			                background-repeat:no-repeat;margin:3px;
			                background-image: url(data:image/jpeg;base64,);
			                width: 850px;
			                background-size: 850px auto;}
			            .name{position:absolute;left:24px;top:82px;width:380px}
			            .paymentPurpose{position:absolute;left:24px;top:170px;width:380px}
			            .institution{position:absolute;left:24px;top:262px;width:380px}
			
			            .paymentCode{position:absolute;left:283px;top:85px;}
			            .currency{position:absolute;left:340px;top:85px}
			            .amount{position:absolute;right:325px;top:85px;}
			
			            .account{position:absolute;left:275px;top:134px;}
			            .model{position:absolute;left:290px;top:183px;}
			            .referenceNumber{position:absolute;left:340px;top:183px;}
			
			            .paymentCode-right{position:absolute;left:580px;top:85px;}
			            .currency-right{position:absolute;left:642px;top:85px}
			            .amount-right{position:absolute;right:24px;top:85px;}
			
			            .account-right{position:absolute;left:575px;top:134px;}
			            
			            .model-right{position:absolute;left:575px;top:183px;}
			            .referenceNumber-right{position:absolute;left:642px;top:183px;}
			            
			            .name-right{position:absolute;left:575px;top:227px;width:380px}
			            .paymentPurpose-right{position:absolute;left:575px;top:314px;width:380px}
			        </style>
			    </head>
			    <body cz-shortcut-listen="true">`
        	;
        for (let i = 1 ; i <= rows.length; i++) {
        	if (rows[i-1].amountDebt == 0) continue;
        	const student = studentsInfo.find(s => rows[i-1].studentId == s.id);
        	const schoolName = student && student.schoolName ? student.schoolName : '';
        	const schoolAddress = student && student.schoolAddress ? student.schoolAddress : '';
        	const schoolAccountNumber = student && student.schoolAccountNumber ? student.schoolAccountNumber : '';
        	pageContent += `
			<div class="invoice">
        		<label class="name">
			        ${rows[i-1].nameStudent}
			    </label>
			    <label class="paymentPurpose">
			        ${paymentPurpose}
			    </label>
			    <label class="institution">
			        ${schoolName}<br/>
			        ${schoolAddress}
			    </label>
			    <label class="paymentCode">
			        121
			    </label>
			    <label class="amount">
			        ${SS.format.formatNumberByLocales(rows[i-1].amountDebt)}
			    </label>
			    <label class="model-right">
			        
			    </label>
			    <label class="account">
			        ${schoolAccountNumber}
			    </label>
			    <label class="referenceNumber">
			        ${rows[i-1].referenceNo}
			    </label>
			    <label class="currency">
			        RSD
			    </label>
			    
        		<label class="name-right">
			        ${rows[i-1].nameStudent}
			    </label>
			    <label class="paymentPurpose-right">
			        ${paymentPurpose}
			    </label>
			    <label class="paymentCode-right">
			        121
			    </label>
			    <label class="amount-right">
			        ${SS.format.formatNumberByLocales(rows[i-1].amountDebt)}
			    </label>
			    <label class="account-right">
			        ${schoolAccountNumber}
			    </label>
			    <label class="model-right">
			        
			    </label>
			    <label class="referenceNumber-right">
			        ${rows[i-1].referenceNo}
			    </label>
			    <label class="currency-right">
			        RSD
			    </label>
			 </div>
        	`;
        	if (i % 3 == 0) pageContent += '<div style="break-after: always; page-break-after: always;"></div>';
        }
        pageContent += '</body></html>'
        document.write(pageContent);
        document.close();
        newWindow.print();
    });
});